import React from "react";
import map from "../public/static/images/themap.jpg";

export const Contact = props => {
  return (
    <section id="Contact">
      <div className="container">
        <div className="map-and-contact">
          <h5 className="comp-title">Contact</h5>
          <div className="box">
            <div className="row">
              <div className="col-md-6">
                <div className="city">Boston, Massachusetts</div>
                <h6 className="address">
                  4 S Market St
                  <br /> Boston, MA
                </h6>
                <p>
                  <strong>EMAIL:</strong>
                  <a href="mailto:contact@heavenly.com">contact@heavenly.com</a>
                </p>
              </div>
              <div className="col-md-6">ONE</div>
            </div>
          </div>
        </div>
      </div>
      <img className="map" src={map} />{" "}
    </section>
  );
};

export default Contact;
